   XDEFUN_MAPPER_INTERNAL(finite, 0, xfinite, xfinite, 0, 0, 0, 0.0, 0.0, 0, 0, "-*- texinfo -*-\n@deftypefn {Mapping Function} {} finite (@var{x})\nReturn 1 for elements of @var{x} that are finite values and zero\notherwise. For example,\n\n@example\n@group\nfinite ([13, Inf, NaN])\n     @result{} [ 1, 0, 0 ]\n@end group\n@end example\n@end deftypefn") ;
